import React from 'react';
import logo from './logo.svg';
import dino from './dino.png';
import AnimateTo from '@microsoft/fast-animation';
import './App.css';

const myHtmlElement = document.getElementById("dino");
const myAnimation = new AnimateTo(myHtmlElement, { x: "30%", scale: 2 }, { duration: 300, delay: 20 });

function App() {


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <img src={dino} id="dino" alt="dino" />
        {myAnimation}
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
